import React, {useState, useEffect} from 'react';
import Stack from '@mui/material/Stack';
import Button from '@mui/material/Button';
import axios from 'axios'

function Dashboard() {
  const[ordini, setOrdini] = useState([])
  useEffect(() => {
      axios.get('http://127.0.0.1:8000/ordinazioni/',[])
      .then(res => {
          console.log(res)
          setOrdini(res.data)
      },)
      .catch(err =>{
          console.log(err)
      })
  },[])
  return (
     
    <div >
        <ul>
      {
          ordini.map(ordini =><Stack spacing={4} direction="row" justifyContent="center"
          alignItems="center">
           <div style="width:50%">{ordini.nome_prenot} - {ordini.totale}</div>
          <Button variant="text">Accettato</Button>
          <Button variant="contained">Consegnato</Button>
          <Button variant="outlined">Rigfiutato</Button>
        </Stack> )
      }
      </ul>
    </div>
  );
}

export default Dashboard;
